import React from 'react'
import Navbar from '../../components/navbar/Navbar'
import './School.css';

function School() {
  const externalImage =
    'https://res.cloudinary.com/do0puhubq/image/upload/v1674985967/Schools/AUBhome_gvbnvj.jpg';
  return (

    <div>
      <Navbar />
      <main className='main' >
        <img src={externalImage} />

         
      </main>
    </div>
  )
}

export default School
